import React, { Component } from 'react';
import { Card, TextField,Button,Container } from '@material-ui/core';

class Login extends Component {
    render() {
        return (
            <div>
                 <Container component="main" maxWidth="xs">
                 <Card>
                    <TextField  fullWidth type="email" id="standard-basic" label="Email" />
                    <TextField  fullWidth type="password" id="standard-basic" label="Password" />
                    <Button type="submit" variant="contained">Sign In</Button>
                </Card>

                 </Container>
               
            </div>
        );
    }
}

export default Login;
